import React from 'react';


export class FloatingMonster extends React.Component {

onComponentDidMount() {
	function doSomething() {}

	(function loop() {
	    var rand = Math.round(Math.random() * (3000 - 500)) + 500;
	    setTimeout(function() {
	            doSomething();
	            loop();  
	    }, rand);
	}());
}

render() {
		return (
			<div id={this.props.id} className={`floating-monster ${this.props.species}`}>
				<div className='head' />
				<div className='torso' />
				<div className='left-arm' />
				<div className='right-arm' />
			</div>
				)
}

}
